import React, { Component } from 'react'
import {
    VictoryBar,
    VictoryChart,
    VictoryTheme
} from 'Victory'

export default class Chart extends Component {
    render() {
        return (
            <VictoryChart
                theme={VictoryTheme.material}
                domainPadding={10}
            >
                <VictoryBar
                    style={{ data: { fill: "#c43a31" } }}
                    data={sampleData}
                />
            </VictoryChart>
        )
    }
}
